package com.iec.core.app.cache;

public class Cache {
	
	private String cache_key;  
	
	private String cache_value;


	public String getCache_key() {
		return cache_key;
	}

	public void setCache_key(String cache_key) {
		this.cache_key = cache_key;
	}

	public String getCache_value() {
		return cache_value;
	}

	public void setCache_value(String cache_value) {
		this.cache_value = cache_value;
	}
	
}


